tables.table_schema:
CREATE TABLE Influencers (
    influencer_id INT PRIMARY KEY,
    influencer_name VARCHAR(255),
    follower_count INT,
    category VARCHAR(50)
);

CREATE TABLE Influencers (
    influencer_id SERIAL PRIMARY KEY,
    influencer_name VARCHAR(50) NOT NULL,
    followers_count INT,
    partnership_status BOOLEAN
);

CREATE TABLE Brands (
    brand_id SERIAL PRIMARY KEY,
    brand_name VARCHAR(50) NOT NULL,
    category VARCHAR(50),
    industry VARCHAR(50)
);
